import  { useState, Suspense } from 'react'
import './Navigation.css'
import Logo from './Logo'
import i18next from 'i18next';
import { initReactI18next } from 'react-i18next';
import { useTranslation } from 'react-i18next';
import en from '../images/en.png'
import ru from '../images/ru.png'
import i18n from '../i18n';
const translationEn= {};
const translationRu = {};



i18n
.use(initReactI18next)
.init( {
	resources:{
		en: {translation:translationEn},
		ru: {translation:translationRu},
	},
	lang: "en",
	fallbackLng:"en",
	interpolation: {escapeValue: false},
})
i18n.changeLanguage(target.value)
const Navigation = () => {
	const { t } = useTranslation();
	return (
		<Suspense fallback="Loading...">
		<nav className='Navbar'>
			<Logo />
			<a href='#' className='Artificialintelligence'>{t("Artificial_msg")}</a>
			<a href='#' className='Home'>{t("Home_msg")}</a>
			<a href='#' className='About'>{t("About_msg")}</a>
			<a href='#' className='Services'>({t("Services_msg")})</a>
			<a href='#' className='Blog'>{t("Blog_msg")}</a>
			<a href='#' className='Contact'>{t("Contact_msg")}</a>
			<option value="en">English</option>
			<option value="ru">Russian</option>
			<btn className='Log_in'><a href=''> {t("Sign In_msg")}</a></btn>	
		</nav>
		</Suspense>
	)
}
export default Navigation;
